"""Fine Fuel Moisture Code (FFMC)"""

def calculate_FFMC(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed):

  #Calculate previous day's fine fuel moisture content, prev_m_t:
  prev_m_t = 147.2 * (101-prev_FFMC)/(59.5+prev_FFMC)

  #In case of rain (precipitation > 0.5mm),
  if precipitation > 0.5:
    p_f = precipitation - 0.5 #effective rainfall (mm)
  
    #Calculate fine fuel moisture content of the current day, m_r_t:
    m_r_t = prev_m_t + (42.5 * p_f * np.exp((-100)/(251-prev_m_t)) * (1-np.exp(-6.93/p_f)))

    if prev_m_t > 150:
      m_r_t += 0.0015*np.power((prev_m_t-150),2)*np.power(p_f,0.5)
    if m_r_t > 250:
      m_r_t = 250

    prev_m_t = m_r_t

  
  #Calculate fine fuel moisture content for drying phases, E_d:
  E_d = 0.942 * np.power(relative_humidity,0.679) + 11 * np.exp((relative_humidity-100)/10) + 0.18 * (21.1-temperature) * (1-np.exp(-0.115*relative_humidity))


  #if E_d < prev_m_t, log drying rate is calculated
  #if E_d >= prev_m_t, fine fuel moisture content for wetting phases is calculated

  if E_d < prev_m_t:

    #Calculate log drying rate, k_d:
    k_o = 0.424 * (1 - np.power((relative_humidity/100),1.7)) + 0.0694*wind_speed*(1 - np.power((relative_humidity/100),8))
    k_d = k_o * 0.581 * np.exp(0.0365 * temperature)

    m_t = E_d + (prev_m_t - E_d) * np.power(10, -k_d)

  else:

    #Calculate fine fuel equilibrium moisture content for wetting phases, E_w:
    E_w = 0.618 * np.power(relative_humidity, 0.753) + 10 * np.exp((relative_humidity-100)/10) + 0.18*(21.1-temperature)*(1-np.exp(-0.115*relative_humidity))

    if E_w > prev_m_t:

      #Calculate log wetting rate, k_w:
      k_1 = 0.424 * (1 - np.power((100-relative_humidity)/100, 1.7)) + 0.0694 * (1 - np.power((100-relative_humidity)/100 , 8))
      k_w = k_1 * 0.581 * np.exp(0.0365*temperature)

      m_t = E_w - (E_w - prev_m_t) * np.power(10, -k_w)

    elif E_w <= prev_m_t and prev_m_t <= E_d:
      m_t = prev_m_t
    #NO OTHER CASE!...


  #Finally, calculate FFMC:
  FFMC = 59.5 * ((250-m_t)/(147.2+m_t))

  

  return FFMC

calculate_FFMC(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed)

"""Duff Moisture Code (DMC)"""

def calculate_DMC(prev_DMC, temperature, relative_humidity, precipitation, month):

  #There are 2 cases: if there is rain (lengthy) and not (shorter)

  #First, find the effective day-length, L_e, for the current month:
  if month == "January":
    L_e = 6.5
  elif month == "February":
    L_e = 7.5
  elif month == "March":
    L_e = 9.0
  elif month == "April":
    L_e = 12.8
  elif month == "May":
    L_e = 13.9
  elif month == "June":
    L_e = 13.9
  elif month == "July":
    L_e = 12.4
  elif month == "August":
    L_e = 10.9
  elif month == "September":
    L_e = 9.4
  elif month == "October":
    L_e = 8.0
  elif month == "November":
    L_e = 7.0
  elif month == "December":
    L_e = 6.0

  #Then, find the log drying rate in DMC, K:
  if temperature < -1.1:
    temperature = -1.1
  K = 1.894 * (temperature + 1.1) * (100 - relative_humidity) * L_e * 0.000001


  if precipitation < 1.5:
    #no rain, simple DMC calculation:
    DMC = prev_DMC + 100*K
  else:
    #rain (precipitation >= 1.5):

    #Calculate effective rainfall (mm), P_e:
    P_e = 0.92 * precipitation - 1.27

    #Calculate duff moisture content from previous day, prev_M:
    prev_M = 20 + np.exp(5.6348 - (prev_DMC)/43.43)

    #Calculate slope variable in DMC rain effect, b:

    if prev_DMC <= 33:
      b = 100 / (0.5 + 0.3 * prev_DMC)
    elif prev_DMC > 33 and prev_DMC <= 65:
      b = 14 - 1.3 * np.log(prev_DMC)
    elif prev_DMC > 65:
      b = 6.2 * np.log(prev_DMC) - 17.2

    #Calculate duff moisture content after rain, M_r_t:
    M_r_t = prev_M + ((1000*P_e)/(48.77 + b*P_e))

    #Calculate DMC after rain, DMC_r_t:
    DMC_r_t = 244.72 - 43.43 * np.log(M_r_t - 20)
    if DMC_r_t < 0:
      DMC_r_t = 0

    
    #Finally, calculate DMC:
    DMC = DMC_r_t + 100 * K

  return DMC

calculate_DMC(prev_DMC, temperature, relative_humidity, precipitation, month)

"""Drought Code (DC)"""

def calculate_DC(prev_DC, temperature, precipitation, month):
  #There are 2 cases: if there is rain (lengthy) and not (shorter)

  #First, find the effective day-length factor, L_f, for the current month:
  if month == "January":
    L_f = -1.6
  elif month == "February":
    L_f = -1.6
  elif month == "March":
    L_f = -1.6
  elif month == "April":
    L_f = 0.9
  elif month == "May":
    L_f = 3.8
  elif month == "June":
    L_f = 5.8
  elif month == "July":
    L_f = 6.4
  elif month == "August":
    L_f = 5.0
  elif month == "September":
    L_f = 2.4
  elif month == "October":
    L_f = 0.4
  elif month == "November":
    L_f = -1.6
  elif month == "December":
    L_f = -1.6

  #Calculate potential evapotranspiration, V:
  if temperature < -2.8:
    temperature = -2.8
  V = 0.36 * (temperature + 2.8) + L_f
  if V < 0:
    V = 0

  if precipitation <= 2.8:
    #no rain, simple DC calculation:
    DC = prev_DC + 0.5*V
  else:
    #rain (precipitation > 2.8):

    #Calculate effective rainfall (mm), P_d:
    P_d = 0.83 * precipitation - 1.27

    #Calculate moisture equivalent of previous day's DC, prev_Q:
    prev_Q = 800 * np.exp(-prev_DC/400)

    #Calculate moisture equivalent after rain, Q_r_t:
    Q_r_t = prev_Q + 3.937*P_d

    #Calculate DC after rain, DC_r_t:
    DC_r_t = 400 * np.log(800/Q_r_t)
    if DC_r_t < 0:
      DC_r_t = 0

    #Calculate DC:
    DC = DC_r_t + 0.5*V

  return DC

calculate_DC(prev_DC, temperature, precipitation, month)

"""Initial Spread Index (ISI)"""

def calculate_ISI(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed):

  FFMC = calculate_FFMC(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed)

  #Calculate fuel moisture content (%), m:
  m = 147.2 * ((101-FFMC)/(59.5+FFMC))

  ISI = 0.208 * np.exp(0.05039*wind_speed) * (91.9 * np.exp(-0.1386*m)) * (1 + (np.power(m,5.31))/49300000)

  return ISI

calculate_ISI(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed)

"""Buildup Index (BUI)"""

def calculate_BUI(prev_DMC, prev_DC, temperature, relative_humidity, precipitation, month):

  DMC = calculate_DMC(prev_DMC, temperature, relative_humidity, precipitation, month)
  DC = calculate_DC(prev_DC, temperature, precipitation, month)

  if DMC <= 0.4 * DC:
    BUI = 0.8 * ((DMC * DC)/(DMC + 0.4*DC))
  else:
    BUI = DMC - (1 - ((0.8*DC)/(DMC + 0.4*DC))) * (0.92 + np.power((0.0114*DMC),1.7))

  return BUI

calculate_BUI(prev_DMC, prev_DC, temperature, relative_humidity, precipitation, month)

"""Fire Weather Index (FWI)"""

def calculate_FWI(prev_FFMC, prev_DMC, prev_DC, temperature, relative_humidity, precipitation, wind_speed, month):
  ISI = calculate_ISI(prev_FFMC, temperature, relative_humidity, precipitation, wind_speed)
  BUI = calculate_BUI(prev_DMC, prev_DC, temperature, relative_humidity, precipitation, month)

  B = 0.1 * ISI

  if BUI <= 80:
    B *= 0.626 * np.power(BUI, 0.809) + 2
  else:
    B *= 1000/(25 + 108.64 * np.exp(-0.023*BUI))

  #Convert from B-scale FWI to S-scale FWI:
  if B > 1:
    S = np.exp(2.72 * np.power(0.434 * np.log(B),0.647))

  return B

calculate_FWI(prev_FFMC, prev_DMC, prev_DC, temperature, relative_humidity, precipitation, wind_speed, month)

