import random
import math

def returnIntersectionArea(point1, point2, point3, r1, r2, r3): #points are vectors
    # determine bounding rectangle
    left   = min(point1[0] - r1, point2[0] - r2, point3[0] - r3)
    right  = max(point1[0] + r1, point2[0] + r2, point3[0] + r3)
    top    = min(point1[1] - r1, point2[1] - r2, point3[1] - r3)
    bottom = max(point1[1] + r1, point2[1] + r2, point3[1] + r3)

    # area of bounding rectangle
    rectArea = (right - left) * (bottom - top)

    iterations = 10000
    pts = 0
    for i in range(iterations):
        # random point coordinates
        x = left + random.random() * (right - left)
        y = top  + random.random() * (bottom - top)

        # check if it is inside all the three circles (the intersecting area)
        if (math.sqrt((x - point1[0]) ** 2 + (y - point1[1]) ** 2) <= r1 and
            math.sqrt((x - point2[0]) ** 2 + (y - point2[1]) ** 2) <= r2 and
            math.sqrt((x - point3[0]) ** 2 + (y - point3[1]) ** 2) <= r3):
            pts += 1

    # the ratio of points inside the intersecting area will converge to the ratio
    # of the area of the bounding rectangle and the intersection
    return pts / iterations * rectArea

point1 = (0,0) 
point2 = (1,0)
point3 = (1,1)

r1 = 1
