"""Approach 2: Exact solution using polygon and arc area 

approach based from https://github.com/benfred/bens-blog-code/blob/master/circle-intersection/circle-intersection.js 

Pseudocode/algo for 3 circles (scale to n later)
1.) Check/find intersections of all 3 circles to return >= points
2.) Check/find all intersection points to return 3 points which are contained in the other circle.
2.) The area of the polygon(triangle) can be calculated from those 3 points
3.) Find the circle which has a subtended arc by checking which circle equation each pair of the 3 points satisfy,
4.) Find the area of the arc using the arc width and circle, do 3x
5.) Return polygon + 3 arc areas
"""

