def getIntersectionPoints_intermediate(circle1, circle2, circle3): #arguments are Circle classes

  #dx and dy are the horizontal and vertical distances between the centres of circles 1 and 2:
  dx = circle2.x - circle1.x
  dy = circle2.y - circle1.y

  #determine the straight-line distance between the centres of circle 1 and 2:
  d = np.power((dy*dy) + (dx*dx),0.5)

  #Check for solvability:
  if (d > (circle1.r + circle2.r)):
    #no solution. circles do not intersect.
    print("No solution; Circles 1 and 2 do not intersect.")
  elif (d < np.absolute(circle1.r - circle2.r)):
    #no solution. one circle is contained in the other
    print("No solution; one circle (1/2) is contained within the other.")

  #'point 2' is the point where the line through the circle intersection points crosses the line between the circle centers.

  #Determine the distance from point 0 to point 2. 
  a = ((circle1.r*circle1.r) - (circle2.r*circle2.r) + (d*d)) / (2.0 * d) ;

  #Determine the coordinates of point 2.
  point2_x = circle1.x + (dx * a/d);
  point2_y = circle1.y + (dy * a/d);

  #Determine the distance from point 2 to either of the intersection points.
  h = np.power((circle1.r*circle1.r) - (a*a),0.5);

  #Now determine the offsets of the intersection points from point 2.
  rx = -dy * (h/d);
  ry = dx * (h/d);

  #Determine the absolute intersection points.
  intersectionPoint1_x = point2_x + rx;
  intersectionPoint2_x = point2_x - rx;
  intersectionPoint1_y = point2_y + ry;
  intersectionPoint2_y = point2_y - ry;

  print("INTERSECTION Circle1 AND Circle2:", "(" + str(intersectionPoint1_x) + "," + str(intersectionPoint1_y) + ")" + " AND (" + str(intersectionPoint2_x) + "," + str(intersectionPoint2_y) + ")")

  #Lets determine if circle 3 intersects at either of the above intersection points. 
  dx = intersectionPoint1_x - circle3.x;
  dy = intersectionPoint1_y - circle3.y;
  d1 = np.power((dy*dy) + (dx*dx),0.5);

  dx = intersectionPoint2_x - circle3.x;
  dy = intersectionPoint2_y - circle3.y;
  d2 = np.power((dy*dy) + (dx*dx),0.5);

  EPSILON = 0.0000000001

  if(np.absolute(d1 - r2) < EPSILON): 
      print("INTERSECTION Circle1 AND Circle2 AND Circle3:", "(" + str(intersectionPoint1_x) + "," + str(intersectionPoint1_y) + ")")
  elif(np.absolute(d2 - r2) < EPSILON): 
      print("INTERSECTION Circle1 AND Circle2 AND Circle3:", "(" + str(intersectionPoint2_x) + "," + str(intersectionPoint2_y) + ")") 
  else: 
      print("INTERSECTION Circle1 AND Circle2 AND Circle3:", "NONE")


