"""Area functions:

1.) Area of circle

2.) Area of overlap of 2 circles (convex)

3.) Complicated areas of case 8

4.) Case by case areas of each colour/probability distribution
"""

import math

#Area of circle:
def area_circle(circle):
  A = math.pi * (circle.r)**2
  return A

#Area of overlap of 2 circles:    (ASSUMES THE 2 CIRCLES INTERSECT)
# def area_overlap_2circles(circle1, circle2):
#   #mathematical concept from: https://www.xarg.org/2016/07/calculate-the-intersection-area-of-two-circles/

#   #find y = euclidean distance between the 2 intersections:
#   intersections = getIntersection_2_circles(circle1, circle2)
#   y = EuclideanDistance(intersections[0], intersections[1])

#   a = circle1.r
#   b = circle2.r

#   A = (a**2) * np.arcsin(y/a) + (b**2) * np.arcsin(y/b) - y * (np.power(a**2 - y**2, 0.5) + np.power(b**2 - y**2, 0.5))

#   return A

def area_overlap_2circles(circle1, circle2):
  d = EuclideanDistance(Point(circle1.x, circle1.y), Point(circle2.x, circle2.y))

  if (d < circle1.r + circle2.r):
    a = circle1.r * circle2.r
    b = circle2.r * circle2.r

    x = (a - b + d * d) / (2 * d)
    z = x * x
    y = np.power(a - z,0.5, dtype='complex')

    if (d <= np.absolute(circle2.r - circle1.r)):
        return math.pi * min(a, b)
    return a * np.arcsin(y / circle1.r) + b * np.arcsin(y / circle2.r) - y * (x + np.power(z + b - a,0.5))
  return 0

def area_overlap_2circles(circle1, circle2):
  intersections = getIntersection_2_circles(circle1, circle2)

  d = EuclideanDistance(intersections[0], intersections[1])

  #area of segment 1:

  r1 = circle1.r
  theta1 = np.arccos((2*r1**2 - (d**2)) / (2*r1**2))
  a_tri1 = r1*np.sin(theta1)
  a_sect1 = 0.5*theta1*(r1**2)

  a_seg1 = a_sect1-a_tri1

  #area of segment 2:

  r2 = circle2.r
  theta2 = np.arccos((2*r2**2 - (d**2)) / (2*r2**2))
  a_tri2 = r2*np.sin(theta2)
  a_sect2 = 0.5*theta2*(r2**2)

  a_seg2 = a_sect2-a_tri2

  return a_seg1 + a_seg2

