"""# Applying GYR functions to Dataset

"""

#function to take geospatial coordinates of 3 stations and their FWI readings and return the area of green, yellow and red:
def GYRtoDataset (lat1, lon1, FWI1,
                  lat2, lon2, FWI2,
                  lat3, lon3, FWI3):
  def Geospatial_to_Cartesian(lat, lon):
    R = 6371  #Radius of Earth (km)
    x = R * np.cos(lat) * np.cos(lon)
    y = R * np.cos(lat) * np.sin(lon)

    return Point(x,y)

  def FWItoRadius(FWI):
    return (-11.242*FWI + 101.88)

  c1 = Geospatial_to_Cartesian(lat1, lon1)
  circle1 = Circle(c1.x, c1.y, r = FWItoRadius(FWI1))
  c2 = Geospatial_to_Cartesian(lat2, lon2)
  circle2 = Circle(c2.x, c2.y, r = FWItoRadius(FWI2))
  c3 = Geospatial_to_Cartesian(lat3, lon3)
  circle3 = Circle(c3.x, c3.y, r = FWItoRadius(FWI3))
  
  coloured_areas = FindColouredAreas(circle1, circle2, circle3)

  return coloured_areas

